mate alliance in cooperation with the German federal states and municipalities.
The aim is to promote cycling by covering as many kilometres as possible in a group effort or individual challenge to reduce C02 emissions.

In 2018 the campaign took place for the eleventh time.Â  However, in 2017, more than 600 municipalities from all over Germany took part with a total of 222,000 participants.

The Climate Alliance is a registered association of municipalities founded in 1990 to fight climate change.Â  Its focus is to reduce fossil fuel burning traffic and to support climate-friendly mobility.
The City Bikes Campaign started in 2008 and has been held annually ever since.Â  Many participants, like local politicians and citizens, switch from car to bicycle during this time of the year.

The City Bikes Berlin has been scheduled from the 2nd to the 22nd of September 2020. Whether you are commuting, on a shopping tour or a trip to the countryside - every cycled kilometre counts.
It is easy just register at stadtradeln-berlin.de

